import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  state = {
    news: []
  }

  handleFetch = () => {
    let url="GET https://api.nytimes.com/svc/topstories/v2/travel.json?api-key=J3xWBLkAx9AAy8xO1BVmOIPG0CoeVWA3"
    fetch(url,{
      method: "GET",
      headers: {
        "Accepts":"application/json"
      }
    })
    .then(resp=>resp.json())
    .then(data=>{
      this.setState({
        news: data
      })
    })
  }

  render(){
    console.log(this.state)
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}
}

export default App;
